    private void validateAppCustomerType(EntityTestCriteria contraints, AppCustomerType appcustomertype) throws SpartanIncorrectDataException, SpartanConstraintViolationException, SpartanPersistenceException {
        if (contraints.getRuleType() == MIN_MAX) {
            appcustomertype.isValid();
        } else if (contraints.getRuleType() == NOT_NULL) {
            appcustomertype.isValid();
        } else if (contraints.getRuleType() == REGEX) {
            appcustomertype.isValid();
        } else if (contraints.getRuleType() == UNIQUE) {
            appcustomertypeRepository.save(appcustomertype);
        }
    }

    private List<EntityTestCriteria> addingListOfFieldForNegativeTesting() {
        List<EntityTestCriteria> entityContraints = new java.util.ArrayList<EntityTestCriteria>();
        entityContraints.add(new EntityTestCriteria(NOT_NULL, 1, "customerType", null));
        entityContraints.add(new EntityTestCriteria(MIN_MAX, 2, "customerType", ""));
        entityContraints.add(new EntityTestCriteria(MIN_MAX, 3, "defaults", 2));
        return entityContraints;
    }

    @Test
    public void test5NegativeTesting() throws NoSuchMethodException, SecurityException, IllegalArgumentException, IllegalAccessException, NoSuchFieldException, Exception, SpartanPersistenceException {
        int failureCount = 0;
        for (EntityTestCriteria contraints : this.entityContraint) {
            try {
                AppCustomerType appcustomertype = createAppCustomerType(false);
                java.lang.reflect.Field field = null;
                if (!contraints.getFieldName().equalsIgnoreCase("CombineUniqueKey")) {
                    field = appcustomertype.getClass().getDeclaredField(contraints.getFieldName());
                }
                switch(((contraints.getTestId()))) {
                    case 0:
                        break;
                    case 1:
                        field.setAccessible(true);
                        field.set(appcustomertype, null);
                        validateAppCustomerType(contraints, appcustomertype);
                        failureCount++;
                        break;
                    case 2:
                        appcustomertype.setCustomerType(contraints.getNegativeValue().toString());
                        validateAppCustomerType(contraints, appcustomertype);
                        failureCount++;
                        break;
                    case 3:
                        appcustomertype.setDefaults(Integer.parseInt(contraints.getNegativeValue().toString()));
                        validateAppCustomerType(contraints, appcustomertype);
                        failureCount++;
                        break;
                }
            } catch (SpartanIncorrectDataException e) {
                e.printStackTrace();
            } catch (SpartanConstraintViolationException e) {
                e.printStackTrace();
            } catch (SpartanPersistenceException e) {
                e.printStackTrace();
            } catch (Exception e) {
                e.printStackTrace();
            }
        }
        if (failureCount > 0) {
            org.junit.Assert.fail();
        }
    }
